import { Component } from '@angular/core';
import { colours, logoUrl } from '../Interfaces/global';
import { colourTemplate } from '../Interfaces/colours';

@Component({
    selector: 'app-navbar',
    templateUrl: './navbar.component.html',
    styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {
	logoUrl: string = logoUrl
	colours: colourTemplate = colours
}
<div 
    class="navbar-container"
    [ngStyle]="{'background': 'linear-gradient(180deg, '+colours.background1+' 35%,'+ colours.background2+'00 100%)'}"
>
    <img 
        [src]="logoUrl" 
        class="logo"
    >

    <div class="links">


    </div>
</div>
